import React from "react";
import Slider from "react-slick";
import Image from "next/image";
import { Wrap } from "../styles/Slider";

function SampleNextArrow(props) {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}

        onClick={onClick}
      >

      <svg
      version="1.1"
      id="Layer_1"
      xmlns="http://www.w3.org/2000/svg"
      x="0px"
      y="0px"
      viewBox="0 0 476.213 476.213"
      style={{ enableBackground: "new 0 0 476.213 476.213" }}
    >
      <polygon
        points="345.606,107.5 324.394,128.713 418.787,223.107 0,223.107 0,253.107 418.787,253.107 324.394,347.5 
345.606,368.713 476.213,238.106 "
      />
      <g></g>
      <g></g>
      <g></g>
      <g></g>
      <g></g>
      <g></g>
      <g></g>
      <g></g>
      <g></g>
      <g></g>
      <g></g>
      <g></g>
      <g></g>
      <g></g>
      <g></g>
    </svg>
    </div>
    );
  }

  function SamplePrevArrow(props) {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}
        style={{ ...style, display: "block", background: "green" }}
        onClick={onClick}
      />
    );
  }


export default function SimpleSlider() {
  var settings = {
    dots: true,
    fade: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />
  };
  return (
    <Wrap>
      <Slider {...settings}>
        <div>
          <Image src="/melodrom-1.jpg" width={450} height={350} />
        </div>
        <div>
          <Image src="/melodrom-2.jpg" width={450} height={350} />
        </div>
        <div>
          <Image src="/melodrom-3.jpg" width={450} height={350} />
        </div>
        <div>
          <Image src="/melodrom-4.jpg" width={450} height={350} />
        </div>
        <div>
          <Image src="/melodrom-5.jpg" width={450} height={350} />
        </div>
      </Slider>
    </Wrap>
  );
}
